<!DOCTYPE html>
<html lang="zh">
<head>
    <meta charset="UTF-8">
    <meta http-equiv="X-UA-Compatible" content="IE=edge">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
	<style type="text/css">
        html, body {
            margin: 0;
            height: 100%;
			width: 100%;
			font: 3vw -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, Oxygen-Sans, Ubuntu, Cantarell, "Helvetica Neue", sans-serif;
        }

		#bk{
			position: relative;
            width: 100vw;
            height: 100vh;
            background-color: rgb(255, 255, 255);
        }

		#W2D{
			position: absolute;
			top:0vh;
			left:0vw;
            width: 100vw;
            height: 100vh;
            background-color: #A3A3A3;
        }

/*2d-角度*/
        #jiao{
            position: absolute;
			top: 10vw;
            left: 7vw;
            width: 30vw;
            height: 20vw;
			background-color: rgba(0,0,0,0);
        }

		#circle{
            position: absolute;
			top: 0vw;
            left: 5vw;
            width: 20vw;
            height: 20vw;
			clip: rect(0px 20vw 20vw 0px);
            overflow: hidden;
			background-color: rgba(0,0,0,0);
        }

		#circle-0{
            position: absolute;
			bottom : -8.5vw;
            left: -8.5vw;
            width: 17vw;
			height: 17vw;
            border-radius: 17vw;
			background-color: #A3A3A3;
        }

		#circle-1{
            position: absolute;
			top : 0vw;
            left: 0vw;
            width: 20vw;
			height: 20vw;
            border-radius: 0 20vw 0 0;
			border:0px solid #333333;
			background-color: rgb(66, 195, 88);
        }
		
		#circle-2{
            position: absolute;
			top : 0vw;
            left: 0vw;
            width: 20vw;
			height: 20vw;
            border-radius: 0 20vw 0vw 0;
			transform-origin: 0% 100% 0;
            transform: rotate(45deg);
			border:0px solid #333333;
			background-color: rgb(102, 102, 102);
        }

		#circle-font-1{
            position: absolute;
			bottom: 1vw;
            left: -2vw;
			color:#000000;
            font-size: 4vh;
            width: 16vw;
            text-align:center;
			//transform: rotate(-90deg);
			border:0px solid #333333;
			background-color: rgba(0,0,0,0);
        }

		#circle-font-2{
            position: absolute;
			bottom : 6vw;
            right: -6vw;
			color:#000000;
            font-size: 4vh;
            width: 16vw;
            text-align:center;
			transform: rotate(-90deg);
			border:0px solid #333333;
			background-color: rgba(0,0,0,0);
        }

		#circle-font-3{
            position: absolute;
			top : 4vw;
            left: 5vw;
			color:#000000;
            font-size: 3vh;
            //transform: rotate(-90deg);
			border:0px solid #333333;
        }

		#circle-font-4{
            position: absolute;
			bottom : 0vw;
            right: 7vw;
			color: rgb(70, 200, 90);
            font-size: 3vh;
			border:0px solid #333333;
        }
/*2d-弧度*/
        #hudu{
            position: absolute;
			bottom: 10vw;
            right: 10vw;
            width: 50vw;
            height: 50vw;
			clip: rect(0px 50vw 50vw 0px);
            overflow: hidden;
			//background-color: rgba(0,0,0,1);
			background-image: url("data:image/png;base64,");
            background-position: 0vw 0vw;
            background-size: 50vw 50vw;
        }

		#hudu-font-1{
            position: absolute;
			bottom : 5vw;
            left: 8vw;
			color:#000000;
            font-size: 4vh;
            width: 14vw;
            text-align:center;
			transform: rotate(40deg);
			background:rgba(0,0,0,0);
        }

		#hudu-font-2{
            position: absolute;
			bottom : 10vw;
            right: 10vw;
			color:#000000;
            font-size: 4vh;
            width: 14vw;
            text-align:center;
			border:0px solid #333333;
			background:rgba(0,0,0,0);
		}
		
		#hudu-font-3{
            position: absolute;
			bottom : 25vw;
            left: 13vw;
			color:#000000;
            font-size: 4vh;
            width: 14vw;
            text-align:right;
			border:0px solid #333333;
			transform: rotate(58deg);
			background:rgba(0,0,0,0);
		}

		#hudu-font-4{
            position: absolute;
			bottom : 26vw;
            right: 9vw;
			color:#000000;
            font-size: 4vh;
            width: 16vw;
            text-align:center;
			border:0px solid #333333;
			transform: rotate(36deg);
			background:rgba(0,0,0,0);
		}
/*2d-中间*/
        #zho{
            position: absolute;
			top : 8vw;
            left: 45vw;
            width: 25vw;
            height: 25vw;
			clip: rect(0vw 25vw 25vw 0vw);
            overflow: hidden;
			background-image: url("data:image/png;base64,");
            background-position: 0vw 0vw;
            background-size: 25vw 25vw;
        }

		#zho-font-1{
            position: absolute;
			top: 2vw;
            left: 3.5vw;
			color:#f000000;
            font-size: 4vh;
            width: 16vw;
            text-align:center;
			border:0px solid #333333;
			background-color: rgba(0,0,0,0);
        }

		#zho-font-2{
            position: absolute;
			bottom: 2vw;
            left: 3.5vw;
			color:#000000;
            font-size: 4vh;
            width: 16vw;
            text-align:center;
			border:0px solid #333333;
			background-color: rgba(0,0,0,0);
        }
/*2d-圆*/
        #yuan {
            position: absolute;
			top : 6vw;
            right: 3vw;
			font-size: 6vh;
			text-align:center;
			color:#000000;
			border:0px solid #A3A3A3;
			background-color: rgba(200, 200, 200, 0);
        }
/*2d-长条*/
        #tiao {
            position: absolute;
			bottom : 10vw;
            left: 0vw;
            width: 16vw;
            height: 8vw;
			font-size: 6vh;
			color:#ffffff;
			text-align:right;
            border-radius: 0 8vw 8vw 0;
			border:0px solid #A3A3A3;
			background-color: rgb(102, 102, 102);
        }
        #tishi {
            position: absolute;
			bottom : 18vw;
            left: 4vw;
			font-size: 5vh;
			color:#000000;
			text-align:right;
			border:0px solid #A3A3A3;
        }
    </style>
</head>
<body>
	<div id="bk">
		<div id="W2D">
			<div id="jiao">
				<div id="circle">
					<div id="circle-1"></div>
					<div id="circle-2"></div>
					<div id="circle-0"></div>
				</div>
				
				<div id="circle-font-1"></div>
				<div id="circle-font-2"></div>
				<div id="circle-font-3">45°</div>
				<div id="circle-font-4">45°</div>
			</div>
			<div id="hudu">
				<div id="yuan">0°</div>
				<div id="hudu-font-1"></div>
				<div id="hudu-font-2"></div>
				<div id="hudu-font-3"></div>
				<div id="hudu-font-4"></div>
			</div>
			<div id="zho">
				<div id="zho-font-1"></div>
				<div id="zho-font-2"></div>
			</div>
			
			
			<div id="tiao">0&nbsp;</div>
			<div id="tishi">直径</div>
		</div>
	</div>
</body>

<script>

        if (window.JsInterface) {
            var a = parseFloat(JsInterface.a());
            var D = parseFloat(JsInterface.D());
            var wt_a = parseFloat(JsInterface.wt_a());
            var wt_b = parseFloat(JsInterface.wt_b());
            var wt_c = parseFloat(JsInterface.wt_c());
            var wt_d = parseFloat(JsInterface.wt_d());
            var wt_g = parseFloat(JsInterface.wt_g());
            var wt_h = parseFloat(JsInterface.wt_h());
            var wt_i = parseFloat(JsInterface.wt_i());
            if (a>45) {
                document.getElementById("circle-1").style.backgroundColor="#46C85A";
                document.getElementById("circle-font-3").style.color="#666666";
                document.getElementById("circle-2").style.backgroundColor="#666666";
                document.getElementById("circle-font-4").style.color="#46C85A";
                var a1= 90-a;
                a1 = parseFloat(a1.toFixed(2));
                document.getElementById("circle-font-3").innerHTML = a+'°';
                document.getElementById("circle-font-4").innerHTML = a1+'°';
            } else {
                document.getElementById("circle-1").style.backgroundColor="#666666";
                document.getElementById("circle-font-3").style.color="#46C85A";
                document.getElementById("circle-2").style.backgroundColor="#46C85A";
                document.getElementById("circle-font-4").style.color="#666666";
                var a1= 90-a;
                a1 = parseFloat(a1.toFixed(2));
                document.getElementById("circle-font-3").innerHTML = a1+'°';
                document.getElementById("circle-font-4").innerHTML = a+'°';
            }


        document.getElementById("zho-font-1").innerHTML = wt_c+'';
        document.getElementById("zho-font-2").innerHTML = wt_d+'';

        document.getElementById("hudu-font-1").innerHTML = wt_g+'';
        document.getElementById("hudu-font-2").innerHTML = wt_i+'';
        document.getElementById("hudu-font-3").innerHTML = wt_i+'';
        document.getElementById("hudu-font-4").innerHTML = wt_h+'';

        document.getElementById("circle-font-1").innerHTML = wt_b+'';
        document.getElementById("circle-font-2").innerHTML = wt_a+'';
        document.getElementById("yuan").innerHTML = a + '°';
        document.getElementById("tiao").innerHTML = D + '&nbsp;';
        }


</script>
</html>